              בשינוי <span style={{ fontWeight: 900 }}>"מפקד גף"</span> או{" "}
              <span style={{ fontWeight: 900 }}>"מפקד יחידה"</span>, הינך מאפשר
              למפקד הגף/יחידה המוגדר לצפות בכלל משובי ההדרכה והחוו"דים המקצועיים
